<div class='wdgpo wdgpo_standard_count'><g:plusone size='standard' count='true' href='http://www.kspowisle.pl/?p=3641' ></g:plusone></div> <p style="text-align: left;">Oboz zimowy na biegowkach<img class="alignright size-large wp-image-3644" src="http://www.kspowisle.pl/wp-content/uploads/IMG_3382-1024x768.jpg" alt="" width="750" height="563" srcset="http://www.kspowisle.pl/wp-content/uploads/IMG_3382-1024x768.jpg 1024w, http://www.kspowisle.pl/wp-content/uploads/IMG_3382-300x225.jpg 300w, http://www.kspowisle.pl/wp-content/uploads/IMG_3382-768x576.jpg 768w, http://www.kspowisle.pl/wp-content/uploads/IMG_3382-200x150.jpg 200w, http://www.kspowisle.pl/wp-content/uploads/IMG_3382-150x113.jpg 150w" sizes="(max-width: 750px) 100vw, 750px" /></p>
<p>Termin: <strong>2.02-9.02.2019</strong></p>
<p>Miejsce: Szklarska Poreba</p>
<p>Koszt: okolo 1000 zl</p>
<p>I rata: <strong>300zl do 15 listopada 2018</strong>, pozostala kwota po ogloszeniu wynikow konkursu na dofinansowanie, najpozniej do dnia wyjazdu. Platnosc przelewem na konto klubowe.</p>
<p>Koszt obejmuje: dojazd pociagiem tam i z powrotem lub autokarem, zakwaterowanie, wyzywienie, dojazd autokarem na trasy narciarskie, wypozyczenie sprzetu, treningi na hali, silowni i na basenie, opieke instruktorow/trenerow, ubezpieczenie.</p>
<p>Oboz tylko dla zawodnikow Klubu Sportowego Powisle.<img class="alignright size-large wp-image-3645" src="http://www.kspowisle.pl/wp-content/uploads/IMG_3615-1024x768.jpg" alt="" width="750" height="563" srcset="http://www.kspowisle.pl/wp-content/uploads/IMG_3615-1024x768.jpg 1024w, http://www.kspowisle.pl/wp-content/uploads/IMG_3615-300x225.jpg 300w, http://www.kspowisle.pl/wp-content/uploads/IMG_3615-768x576.jpg 768w, http://www.kspowisle.pl/wp-content/uploads/IMG_3615-200x150.jpg 200w, http://www.kspowisle.pl/wp-content/uploads/IMG_3615-150x113.jpg 150w" sizes="(max-width: 750px) 100vw, 750px" /></p>
