Nabor do nowej grupy				</a>
</h2>
<div class="entry-meta">
&nbsp; <span class="author vcard" >przez  <a class="url fn n" rel="author" href="http://www.kspowisle.pl/?author=2" title="Zobacz wszystkie wpisy opublikowane przez Krysia">Krysia</a> <span class="bl_sep">|</span></span>  <time class="onDate date published" datetime="2018-08-27T17:33:45+00:00"> <a href="http://www.kspowisle.pl/?p=3595" title="17:33" rel="bookmark"><span class="entry-date">27 sierpnia 2018</span> <span class="entry-time"> - 17:33</span></a> </time><span class="bl_sep">|</span><time class="updated"  datetime="2018-09-07T22:05:53+00:00">7 wrzesnia 2018</time> <span class="bl_categ"> <a href="http://www.kspowisle.pl/?cat=7" rel="category">Aktualnosci</a> </span>  							<div class="comments-link">
<span>Mozliwosc komentowania <span class="screen-reader-text">Nabor do nowej grupy</span> zostala wylaczona</span>			</div>
</div><!-- .entry-meta -->


</header><!-- .entry-header -->
<div class="entry-content">
<div class='wdgpo wdgpo_standard_count'><g:plusone size='standard' count='true' href='http://www.kspowisle.pl/?p=3595' ></g:plusone></div> <p>Zapraszamy od wrzesnia wszystkich chetnych w wieku od 8 do 13 lat na treningi kajak polo. Tworzymy nowa grupe, w ktorej uczymy &#8222;od zera&#8221; plywania na kajaku i gry w kajak polo. Treningi odbywac sie beda w weekendy, pozniej rowniez w srody:<img class="alignright wp-image-3603" src="http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-1024x477.jpg" alt="" width="400" height="186" srcset="http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-1024x477.jpg 1024w, http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-300x140.jpg 300w, http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-768x358.jpg 768w, http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-250x116.jpg 250w, http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-150x70.jpg 150w" sizes="(max-width: 400px) 100vw, 400px" /></p>
<p>(Zaktualizowano terminy zajec)</p>
<p>8 i 9 wrzesnia godz. 12.00<br />
15 i 16 wrzesnia godz. 12.00<br />
22 wrzesnia godz. 12.00<br />
29 wrzesnia godz 12.00</p>
<p>Szczegoly przystapienia do klubu znajduja sie <a href="http://www.kspowisle.pl/?page_id=1236">tutaj.</a></p>
<p>Kontakt do trenerki 517 134 833 klub@kspowisle.pl</p>
<p>Trenujac KAJAK POLO w Powislu bedziesz mial okazje:<br />
- grac w gre zespolowa, ktorej nikt nie zna ale kazdy jest nia zainteresowany<br />
- wyjezdzac na turnieje w Polsce i za granica<br />
- spedzic wakacje i ferie zimowe na obozie sportowym<br />
- zawrzec nowe znajomosci.</p>
<p>W okresie letnim od konca kwietnia do pazdziernika trenujemy na wodzie w Porcie Czerniakowskim. Siedziba klubu miesci sie w Klubie Rejsy przy ul. Solec 8. W okresie zimowym gramy w kajak polo na basenie, doskonalimy plywanie wplaw i gramy w pilke reczna na hali.</p>
<p>Trenujemy rowniez w wakacje.<br />
Zajecia dla dzieci i mlodziezy prowadzone sa przez wykwalifikowana kadre instruktorow. Zawodnicy sa ubezpieczeni. Klub zapewnia sprzet niezbedny do treningow: kajaki, wiosla, kapoki, kaski i pilki.</p>
<p>Zapraszamy!</p>
<p><img class="alignright wp-image-3604" src="http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-2-1024x478.jpg" alt="" width="500" height="234" srcset="http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-2-1024x478.jpg 1024w, http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-2-300x140.jpg 300w, http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-2-768x359.jpg 768w, http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-2-250x117.jpg 250w, http://www.kspowisle.pl/wp-content/uploads/FullSizeRender-2-150x70.jpg 150w" sizes="(max-width: 500px) 100vw, 500px" /></p>
</div><!-- .entry-content -->
